import './App.css';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Dashboard from './components/dashboard';

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/app">
          <Dashboard />
        </Route>
      </Router>
    </div >
  );
}

export default App;
